description:
Dominator is een jaarlijks hardcorefestival georganiseerd door Art of Dance en Q-Dance. Dominator staat bekend als het grootste hardcore festival van de wereld. Er komen mensen uit verscheidene landen naar Nederland speciaal voor dit evenement.


De eerste editie werd gehouden op 30 juli 2005 op recreatiepark Het Rutbeek in Enschede. In 2006 werd Dominator niet georganiseerd. In 2007 keerde Dominator terug, ditmaal in het Stadspark van Groningen. De derde editie van was op 26 juli 2008 op recreatieterrein Vlietland in Leidschendam. Vanaf 2009 wordt Dominator georganiseerd op het E3-strand in Eersel. Ook in 2010 heeft het festival plaatsgevonden op het E3-strand in Eersel.

